import React, { useState } from 'react';
import { Router, Link } from "@reach/router";
import { LinkButton } from '../styles/Link'
import styled from 'styled-components'

var HomeContainer = styled.div`
    display: flex;
    flex-flow: row no-wrap;

`;

var Home = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <HomeContainer>
            <p>You clicked  Home</p>
            <div style={{ background: 'blue', width: '30%' }}>jhh</div>
            <LinkButton to="csv">Csv Generation</LinkButton>
            <LinkButton to="config">Config Generation</LinkButton>
            <Link style={{ background: 'blue', width: '400px' }} to="config">Config Generation</Link>
            <a style={{ background: 'red', width: '400px' }}>jhh</a>
        </HomeContainer>
    );
}

export { Home };
